import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function createMap(note){
    return <Note />
}

function App() {
    return (
        <div>
            <Header />
            {notes.map(createMap)}
            <Footer />
        </div>
    )
}

export default App;
